var documenterSearchIndex = {"docs":
[{"location":"factors/#work_w_factors","page":"Factors","title":"Working with Factors","text":"","category":"section"},{"location":"factors/","page":"Factors","title":"Factors","text":"Factors represent the interaction between particular variables. Factors define the algebra structure between variables via probabilistic measurement models as captured measurement or data cues.  For example, a distance travelled measurement between two pose variables. Relative factors between variables are probabilistic models that capture the likelihood interactions between variables. Priors factors (i.e. unary to one variable) represent absolute information to be introduced about that variable, for example a GPS measurement; more on how to introduce distrust of such priors later.","category":"page"},{"location":"factors/#List-or-Get-Factors","page":"Factors","title":"List or Get Factors","text":"","category":"section"},{"location":"factors/","page":"Factors","title":"Factors","text":"All factors in a graph can be listed via:","category":"page"},{"location":"factors/","page":"Factors","title":"Factors","text":"flbls = listFactors(client, context) |> fetch\n# [\"x0f_8ebc\", ...]\n\n# and for a naturally ordered list\nflbls = sort(flbls; lt=NvaSDK.natural_lt)","category":"page"},{"location":"factors/","page":"Factors","title":"Factors","text":"Note the factor labels are autogenerated based on the variables and a random sequence.  For example a prior factor might have the label x0f_8ebc, while factor between three variables might be x7x49l4f_654t.","category":"page"},{"location":"factors/","page":"Factors","title":"Factors","text":"A specific factor can be retrieved using the label:","category":"page"},{"location":"factors/","page":"Factors","title":"Factors","text":"f = getFactor(client, context, flbls[1]) |> fetch\n# Dict{String, Any} with 8 entries:\n#   \"label\"                 => \"x0f_8ebc\"\n#   \"_variableOrderSymbols\" => Any[\"x0\"]\n#   \"data\"                  => \"eyJlbGltaW5hdGVkIjpmYWxzZSwicG90ZW50aWFsdXNlZCI6Z…\n#   \"tags\"                  => Any[\"FACTOR\"]\n#   \"timestamp\"             => \"2023-02-11T22:36:49.171Z\"\n#   \"_version\"              => \"0.18.6\"\n#   \"fnctype\"               => \"PriorPose2\"\n#   \"solvable\"              => 1","category":"page"},{"location":"factors/","page":"Factors","title":"Factors","text":"listFactors\ngetFactor","category":"page"},{"location":"factors/#NavAbilitySDK.listFactors","page":"Factors","title":"NavAbilitySDK.listFactors","text":"listFactors(navAbilityClient, client)\n\n\nGet a list of the Factors as labels in the graph.\n\n\n\n\n\n","category":"function"},{"location":"factors/#NavAbilitySDK.getFactor","page":"Factors","title":"NavAbilitySDK.getFactor","text":"getFactor(navAbilityClient, client, label)\n\n\nGet a Factor from a graph context using its label.\n\nReturn: Task containing the Factor.\n\n\n\n\n\n","category":"function"},{"location":"factors/#App-Graph-Visualization","page":"Factors","title":"App Graph Visualization","text":"","category":"section"},{"location":"factors/","page":"Factors","title":"Factors","text":"The NavAbilityApp can also visualize a specific factor graph session, and a convenient link generator can be used to simplify the session filtering criteria:","category":"page"},{"location":"factors/","page":"Factors","title":"Factors","text":"GraphVizApp(context, variableStartsWith=\"\")\n# https://app.navability.io/cloud/graph/?userId=guest@navability.io&robotStartsWith=SDKjl_0181&sessionStartsWith=Tutorial1_af33&variableStartsWith","category":"page"},{"location":"factors/","page":"Factors","title":"Factors","text":"A variableStartsWith=\"l\" type filter can be used to filter the visualization to more specific elements of the graph.  This is useful in large graphs where the visualization easily overwhelms the display – e.g. just show variables starting with l which may indicate landmarks.","category":"page"},{"location":"factors/","page":"Factors","title":"Factors","text":"note: Note\nA console output will only produce the text URL as above, but Markdown enhanced output (such as Jupyter or Pluto notebooks) will also produce a clickable graphic.","category":"page"},{"location":"factors/","page":"Factors","title":"Factors","text":"The NavAbilityApp Graph visualization page can also be found in the hamburger menu (top right).  Once on the Graph visualization page, the global filter menu (top left) can be used to look for specific user, robot, session, and starts with criteria.  Here is an example following from earlier (as per one of the ICRA 2022 tutorials) showing a variable x0 and the unary prior factor x0f_8ebc:","category":"page"},{"location":"factors/","page":"Factors","title":"Factors","text":"<a href=\"https://app.navability.io/cloud/graph/?userId=guest@navability.io&robotStartsWith=SDKjl_0181&sessionStartsWith=Tutorial1_af33&variableStartsWith\">\n<p align=\"center\">\n<img src=\"https://user-images.githubusercontent.com/6412556/218284321-83fad03b-ea54-4a0a-976d-49020f48dcd4.png\" width=\"480\" border=\"0\" />\n</p>\n</a>","category":"page"},{"location":"factors/","page":"Factors","title":"Factors","text":"GraphVizApp","category":"page"},{"location":"factors/#NavAbilitySDK.GraphVizApp","page":"Factors","title":"NavAbilitySDK.GraphVizApp","text":"struct GraphVizApp\n\nHelper type for linking to App visualization of a factor graph for user:robot:session.\n\n\n\n\n\n","category":"type"},{"location":"factors/#SDK-Supported-Factors","page":"Factors","title":"SDK Supported Factors","text":"","category":"section"},{"location":"factors/","page":"Factors","title":"Factors","text":"The list of currently supported factors in the SDK are:","category":"page"},{"location":"factors/","page":"Factors","title":"Factors","text":"Prior, for 1D Euclidean only.\nLinearRelative, for Euclidean only.\nPoint2Point2Range\nPriorPoint2\nPriorPose2\nPose2Pose2\nScatterAlignPose2\nPose2AprilTag4Corners\nPose2Point2BearingRange\nPriorPose3\nPose3Pose3","category":"page"},{"location":"factors/","page":"Factors","title":"Factors","text":"note: Note\nMany more factor types are already supported by the solver, see additional docs here.  Reach out to NavAbility for help or support in bringing more variable types to eh SDK sooner, or for help in building more factor types that may not yet exist in either libraries.","category":"page"},{"location":"factors/#Factor-Index","page":"Factors","title":"Factor Index","text":"","category":"section"},{"location":"factors/","page":"Factors","title":"Factors","text":"NvaSDK.ZInferenceType\nNvaSDK.InferenceType\nNvaSDK.PriorData\nNvaSDK.LinearRelativeData\nNvaSDK.PriorPoint2Data\nNvaSDK.Point2Point2RangeData\nNvaSDK.PriorPose2Data\nNvaSDK.Pose2Pose2Data\nNvaSDK.Pose2Point2BearingRangeData\nNvaSDK.PriorPose3Data\nNvaSDK.Pose3Pose3Data\nNvaSDK.ScatterAlignPose2\nNvaSDK.Pose2AprilTag4Corners","category":"page"},{"location":"factors/#NavAbilitySDK.ZInferenceType","page":"Factors","title":"NavAbilitySDK.ZInferenceType","text":"struct ZInferenceType <: NavAbilitySDK.InferenceType\n\nZInferenceType is used by many factors as a common inference type that uses a single distribution to express a constraint between variables. Used by: Prior, LinearRelative, PriorPose2, PriorPoint2, Pose2Pose2, Point2Point2Range, etc.\n\n\n\n\n\n","category":"type"},{"location":"factors/#NavAbilitySDK.InferenceType","page":"Factors","title":"NavAbilitySDK.InferenceType","text":"abstract type InferenceType\n\nAbstract parent type for all InferenceTypes, which are the functions inside of factors.\n\n\n\n\n\n","category":"type"},{"location":"factors/#NavAbilitySDK.PriorData","page":"Factors","title":"NavAbilitySDK.PriorData","text":"PriorData(; Z, kwargs...)\n\n\nCreate a prior factor for a ContinuousScalar (a.k.a. Pose1) with a distribution Z representing 1D prior information,      e.g. Normal(0.0, 0.1).\n\nDefault value of Z = Normal(0.0, 0.1).\n\n\n\n\n\n","category":"function"},{"location":"factors/#NavAbilitySDK.LinearRelativeData","page":"Factors","title":"NavAbilitySDK.LinearRelativeData","text":"LinearRelativeData(; Z, kwargs...)\n\n\nCreate a ContinousScalar->ContinousScalar (also known as Pose1->Pose1) factor with a distribution Z representing the 1D relationship between the variables, e.g. Normal(1.0, 0.1).\n\nDefault value of Z = Normal(1.0, 0.1).\n\n\n\n\n\n","category":"function"},{"location":"factors/#NavAbilitySDK.PriorPoint2Data","page":"Factors","title":"NavAbilitySDK.PriorPoint2Data","text":"PriorPoint2Data(; Z, kwargs...)\n\n\nCreate a prior factor for a Point2 with a distribution Z representing (x,y) prior information,      e.g. FullNormal([0.0, 0.0.0], diagm([0.01, 0.01])).\n\nDefault value of Z = FullNormal([0.0, 0.0], diagm([0.01, 0.01])).\n\n\n\n\n\n","category":"function"},{"location":"factors/#NavAbilitySDK.Point2Point2RangeData","page":"Factors","title":"NavAbilitySDK.Point2Point2RangeData","text":"Point2Point2RangeData(; range, kwargs...)\n\n\nCreate a Point2->Point2 range factor with a 1D distribution:\n\nrange: The range from the pose to the point, default Normal(1, 1).\n\n\n\n\n\n","category":"function"},{"location":"factors/#NavAbilitySDK.PriorPose2Data","page":"Factors","title":"NavAbilitySDK.PriorPose2Data","text":"PriorPose2Data(; Z, kwargs...)\n\n\nCreate a prior factor for a Pose2 with a distribution Z representing (x,y,theta) prior information,      e.g. FullNormal([0.0, 0.0, 0.0], diagm([0.01, 0.01, 0.01])).\n\nDefault value of Z = FullNormal([0.0, 0.0, 0.0], diagm([0.01, 0.01, 0.01])).\n\n\n\n\n\n","category":"function"},{"location":"factors/#NavAbilitySDK.Pose2Pose2Data","page":"Factors","title":"NavAbilitySDK.Pose2Pose2Data","text":"Pose2Pose2Data(; Z, kwargs...)\n\n\nCreate a Pose2->Pose2 factor with a distribution Z representing the (x,y,theta) relationship between the variables, e.g. FullNormal([1,0,0.3333*π], diagm([0.01,0.01,0.01])).\n\nDefault value of Z = FullNormal([1,0,0.3333*π], diagm([0.01,0.01,0.01])).\n\n\n\n\n\n","category":"function"},{"location":"factors/#NavAbilitySDK.Pose2Point2BearingRangeData","page":"Factors","title":"NavAbilitySDK.Pose2Point2BearingRangeData","text":"Pose2Point2BearingRangeData(; bearing, range, kwargs...)\n\n\nCreate a Pose2->Point2 bearing+range factor with 1D distributions:\n\nbearing: The bearing from the pose to the point, default Normal(0, 1).\nrange: The range from the pose to the point, default Normal(1, 1).\n\n\n\n\n\n","category":"function"},{"location":"factors/#NavAbilitySDK.PriorPose3Data","page":"Factors","title":"NavAbilitySDK.PriorPose3Data","text":"PriorPose3Data(; Z, kwargs...)\n\n\nCreate a prior factor for a Pose3 with a distribution Z representing (x,y,z,i,j,k) prior information,      e.g. FullNormal(zeros(6), diagm(0.01*ones(6))).\n\nDefault value of Z = FullNormal(zeros(6), diagm(0.01*ones(6))).\n\n\n\n\n\n","category":"function"},{"location":"factors/#NavAbilitySDK.Pose3Pose3Data","page":"Factors","title":"NavAbilitySDK.Pose3Pose3Data","text":"Pose3Pose3Data(; Z, kwargs...)\n\n\nCreate a Pose3->Pose3 factor with a distribution Z representing the (x,y,theta) relationship between the variables, e.g. FullNormal([1;zeros(5)], diagm(0.01*ones(6))).\n\nDefault value of Z = FullNormal(zeros(6), diagm(0.01*ones(6))).\n\n\n\n\n\n","category":"function"},{"location":"factors/#NavAbilitySDK.ScatterAlignPose2","page":"Factors","title":"NavAbilitySDK.ScatterAlignPose2","text":"Alignment factor between point cloud populations, using either\n\na continuous density function cost: ApproxManifoldProducts.mmd, or\na conventional iterative closest point (ICP) algorithm (when .sample_count < 0).\n\nThis factor can support very large density clouds, with sample_count subsampling for individual alignments.\n\n\n\n\n\n","category":"type"},{"location":"factors/#NavAbilitySDK.Pose2AprilTag4Corners","page":"Factors","title":"NavAbilitySDK.Pose2AprilTag4Corners","text":"struct Pose2AprilTag4Corners <: NavAbilitySDK.InferenceType\n\nInferenceType for Pose2AprilTag4CornersData.\n\n\n\n\n\n","category":"type"},{"location":"variables/#work_w_variables","page":"Variables","title":"Working with Variables","text":"","category":"section"},{"location":"variables/#Inspect-an-Existing-Graph","page":"Variables","title":"Inspect an Existing Graph","text":"","category":"section"},{"location":"variables/","page":"Variables","title":"Variables","text":"Most use cases will involve retrieving information from a factor graph session already available on the server.  With auth auth token, setup the connections to API server:","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"# copy the auth token from the NavAbility App\nauth_token = \"r3ft ... eo7_\"\n\n# also create a client connection\nclient = NavAbilityHttpsClient(;auth_token)\n\n# create a client context user, robot, session\ncontext = Client(\n  # you need a unique userId:robotId, and can keep using that across all tutorials\n  \"guest@navability.io\",\n  \"ExampleRobot\",\n  # You'll need a unique session number each time you run a new graph\n  \"Hexagonal\",\n)","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"NavAbilityHttpsClient\nClient","category":"page"},{"location":"variables/#NavAbilitySDK.NavAbilityHttpsClient","page":"Variables","title":"NavAbilitySDK.NavAbilityHttpsClient","text":"NavAbilityHttpsClient()\nNavAbilityHttpsClient(apiUrl; auth_token, authorize)\n\n\nObject for handling main interactions with API for queries and mutations.\n\nDevNotes\n\nTODO TBD, rather use upstream retry logic instead, \nsee https://github.com/JuliaWeb/HTTP.jl/pull/974/files\n\n\n\n\n\n","category":"function"},{"location":"variables/#NavAbilitySDK.Client","page":"Variables","title":"NavAbilitySDK.Client","text":"struct Client\n\nThe context for a session, made from a user, robot, and session. Users can have multiple robots and robots can have multiple sessions. So this indicates a unique session.\n\nDevNotes\n\nTODO, rename possibly, SessionKey\n\n\n\n\n\n","category":"type"},{"location":"variables/#Variables","page":"Variables","title":"Variables","text":"","category":"section"},{"location":"variables/","page":"Variables","title":"Variables","text":"Variables represent state variables of interest such as vehicle or landmark positions, sensor calibration parameters, and more. Variables are likely hidden values that are not directly observed, but we want to estimate them from observed data.  Let's start by listing all the variables in the session:","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"varLbls = fetch(listVariables(client, context))\n# [\"l1\",\"x0\",\"x1\",\"x2\",\"x3\",\"x4\",\"x5\",\"x6\"]","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"The fetch call is used to wait on the underlying asynchronous call.","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"listVariables","category":"page"},{"location":"variables/#NavAbilitySDK.listVariables","page":"Variables","title":"NavAbilitySDK.listVariables","text":"listVariables(client, context)\n\n\nGet a list of Variable labels in the graph.\n\nReturns: A Task with response ::Vector{String}.\n\n\n\n\n\n","category":"function"},{"location":"variables/#Data-BlobEntryBlob","page":"Variables","title":"Data BlobEntry=>Blob","text":"","category":"section"},{"location":"variables/","page":"Variables","title":"Variables","text":"Additional data attached to variables exist in a few different ways.  The primary method for storing additional large data blobs with a variable, is to look at the BlobEntrys associated with a particular variable.  For example:","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"de = listBlobEntries(client, context, \"x0\") |> fetch\nde .|> s->s[\"blobLabel\"]\n# e.g. [\"Camera0\", \"user_calibration\", etc.]","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"Data blobs can be fetched via, e.g. using the unique blobId of the first dataEntry on this variable:","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"blob = getBlob(client, context, de[1][\"blobId\"]; checkhash=false)\n# [0x2e, 0x45, ..., 0x2b] # length 1225 bytes","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"Data blobs are provided in binary format (i.e. ::Vector{UInt8}).  A blob can be associated via any number of BlobEntrys across multiple graph nodes, sessions, or robots.  BlobEntry also stores a hash value to ensure data consistency which must correspond to teh stored hash upon retrieval.  The check can be skipped as indicated by the option in the function call above.","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"See Tutorial 5 from ICRA 2022 for a more indepth example of working with data blobs.","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"note: Note\nA blob is owned by a user and only accessible by other users if allowed via approved roles or permissions.","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"note: Note\nAll blobIds are unique across the entire distributed system and are immutable.","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"listBlobEntries\ngetBlob","category":"page"},{"location":"variables/#NavAbilitySDK.listBlobEntries","page":"Variables","title":"NavAbilitySDK.listBlobEntries","text":"listBlobEntries(w)\n\n\nList the blob entries associated with a particular variable.\n\nInput: client, context, varLbl\n\nReturns: Task containing a list of BlobEntrys\n\n\n\n\n\n","category":"function"},{"location":"variables/#NavAbilitySDK.getBlob","page":"Variables","title":"NavAbilitySDK.getBlob","text":"getBlob(client, context, blobId)\n\n\nGet the data blob as defined by a unique blobId::UUID identifier.\n\nReturns: Task containing the blob\n\nDevNotes\n\nTODO standardize return type as ::Vector{UInt8} (not an IOBuffer/PipeBuffer)\n\nSee also: listBlobEntries\n\n\n\n\n\n","category":"function"},{"location":"variables/#Numerical-Solution","page":"Variables","title":"Numerical Solution","text":"","category":"section"},{"location":"variables/","page":"Variables","title":"Variables","text":"The main purpose of using a factor graph is not only as data index but also to deeply connect with the mapping and localization problem.  Variables in the factor graph represent the states to be estimated from the relevant measurement data.  The numerical values for each variable are computed by any number of solver operations.  The numerical results are primarily stored in a variables solverData field, such that either parametric or non-parametric inference results can be used:","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"v0 = getVariable(client, context, \"x0\")","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"getVariable","category":"page"},{"location":"variables/#NavAbilitySDK.getVariable","page":"Variables","title":"NavAbilitySDK.getVariable","text":"getVariable(navAbilityClient, client, label; detail)\n\n\nGet a Variable from a graph using its label.\n\nReturns: Task with reponse Variable.\n\n\n\n\n\n","category":"function"},{"location":"variables/#Understanding-solveKeys","page":"Variables","title":"Understanding solveKeys","text":"","category":"section"},{"location":"variables/","page":"Variables","title":"Variables","text":"Since various numerical solutions may exists for the same factor graph, we introduce the idea of a solveKey.  Different numerical values for different solveKeys can exists for any number of reasons.  Using the example from above, we might find:","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"v0[\"solverData\"][1][\"solveKey\"]\n# graphinit\nv0[\"solverData\"][2][\"solveKey\"]\n# default\nv0[\"solverData\"][3][\"solveKey\"]\n# parametric","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"Each of these solverDatas are unique identified via the solveKey.  The graphinit solver values are a duplicate of the numerical values for the variable before inference computation was performed.  In this example the default key corresponds to the nonparametric solution, and parametric represents a Gaussian only parametric solution.","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"The numerical values can be obtained from the solverData via:","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"v0[\"solverData\"][3][\"vecval\"]\n# [-0.001, 0.002, 0.001]","category":"page"},{"location":"variables/#Understanding-PPEs","page":"Variables","title":"Understanding PPEs","text":"","category":"section"},{"location":"variables/","page":"Variables","title":"Variables","text":"To better bridge the gap between non-Gaussian and Gaussian solutions, variables also store a convenience numerical solution called the parametric point estimate (PPE) for each of the solveKeys.  While various forms of PPEs can exists–-such as mean, max, modes, etc.–-a common suggested field exists for basic usage.  For example, the suggested parametric equivalent solution from the nonparametric solver (default) can be obtained by:","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"xyr = v0[\"ppes\"][2][\"suggested\"]\n# [-0.00, 0.00, 0.00]","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"warning: Warning\nAt time of writing these numerical values represent the solution stored in coordinates.  In the future, these values are expected to stored directly as on-manifold point representations.  The internal solver computations are already all on-manifold.  For more information, see the on-manifold points, tangent vectors, and coordinates description presented here.","category":"page"},{"location":"variables/#SDK-Supported-Variables","page":"Variables","title":"SDK Supported Variables","text":"","category":"section"},{"location":"variables/","page":"Variables","title":"Variables","text":"The list of variable types currently supported by the SDK are:","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"Position1 / ContinuousScalar\nPosition2 / Point2\nPose2\nPosition3 / Point3\nPose3","category":"page"},{"location":"variables/","page":"Variables","title":"Variables","text":"note: Note\nMany more variable types are already supported by the solver, see additional docs here.  Reach out to NavAbility for help or support in bringing more variable types to the SDK sooner, or for help in building more variable types that may not yet exist in either libraries.","category":"page"},{"location":"buildgraph/#Build-a-new-Factor-graph","page":"Build a Graph","title":"Build a new Factor graph","text":"","category":"section"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"The NavAbilitySDK provides variables and factors useful to robotics.  We start with a Pose2 variable, i.e. position and orientation for a vehicle traveling on a flat XY plane.  ","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"As before, let's setup a new client-context to talk with the NavAbility platform:","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"# also create a client connection\nclient = NavAbilityHttpsClient()\n\n# create a client context user, robot, session\ncontext = Client(\n  \"guest@navability.io\",\n  \"ExampleRobot\",\n  \"SDKjl_\"*(string(uuid4())[1:4]),\n)","category":"page"},{"location":"buildgraph/#First-Pose","page":"Build a Graph","title":"First Pose","text":"","category":"section"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"The addVariable function with a label \"x0\" and type :Pose2 adds that variable to  to the factor graph.","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"# let's collect all the async responses and wait at the end\nresultIds = Task[]\n# addVariable and keep the transaction ID\npush!(resultIds, \n  addVariable(client, context, \"x0\", :Pose2)\n);","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"Note that asynchronous tasks are used to increase the upload performance.  Each of these events are queued on the server for processing.  While the variable is being created, let's also add a prior factor.","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"We now have a factor graph with one variable, but to solve it we need some additional information.  In this example, we need the estimated starting point of our robot. We use unary factors called priors to represent absolute information to be introduced.  In this case we use PriorPose2, as our variable type is also Pose2. Since factors represent a probabilistic interaction between variables, we need to specify the distribution our factor will represent. Here we use FullNormal which is a multivariate normal distribution. ","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"Let's create a PriorPose2 unary factor with zero mean and a covariance matrix of (diagm([0.05,0.05,0.01].^2)):","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"push!(\n  resultIds, \n  addFactor(\n    client, context, [\"x0\"], \n    NVA.PriorPose2(;\n      Z=FullNormal(\n        [0.0, 0.0, 0.0], \n        diagm([0.05, 0.05, 0.01].^2)\n      )\n    )\n  )\n)","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"After adding a batch of variables and factors, we can wait on the upload status to ensure the new graph elements have been processed:","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"# wait to make sure all nodes were added\nwaitForCompletion(client, resultIds; expectedStatuses=[\"Complete\"])","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"As before, we can use the NavAbility App to visualize the factor graph","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"# Click on the generated URL or graphic to open the NavAbility App Graph visualization page for this session\nGraphVizApp(context, variableStartsWith=\"\")","category":"page"},{"location":"buildgraph/#Odometry-Factor","page":"Build a Graph","title":"Odometry Factor","text":"","category":"section"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"An odometry factor connects two consecutive robot poses x0 and x1 together to form a chain.  Here we use a relative factor of type Pose2Pose2 with a measurement from pose x0 to x1 of (x=1.0,y=0.0,θ=pi/2); the robot drove 1 unit forward (in the x direction).  Similarly to the prior we added above, we use a FullNormal distribution to represent the odometry with mean and covariance:","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"# reset waiting list\nresultIds = Task[]\n# add x1\npush!(resultIds, \n  addVariable(client, context, \"x1\", :Pose2)\n)\n\n# add odometry measurement between x0 and x1\npush!(\n  resultIds, \n  addFactor(client, context, [\"x0\",\"x1\"],\n    NVA.Pose2Pose2(;\n      Z=FullNormal(\n        [1.0, 0.0, pi/2], \n        diagm([0.1, 0.1, 0.01].^2)\n      )\n    )\n  )\n);","category":"page"},{"location":"buildgraph/#Adding-Different-Sensors","page":"Build a Graph","title":"Adding Different Sensors","text":"","category":"section"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"So far we worked with the Pose2 factor type.  Among others, NavAbilitySDK also provides the Point2 variable and Pose2Point2BearingRange factor types, which we will use to represent a landmark sighting in our factor graph.  We will add a landmark l1 with bearing range measurement of bearing=(mu=0,sigma=0.03) range=(mu=0.5,sigma=0.1) and continue our robot trajectory by driving around in a square.","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"# add one landmark\npush!(resultIds,\n  addVariable(client, context, \"l1\", :Point2))\n\n# add three more poses\nfor x in [\"x2\"; \"x3\"; \"x4\"]\n  push!(resultIds,\n    addVariable(client, context, x, :Pose2))\nend\n\n## add Factors\n\n# add landmark observation measurement and\npush!(resultIds, \n  addFactor(client, context, [\"x0\",\"l1\"], \n    NVA.Pose2Point2BearingRange(Normal(0, 0.03), Normal(0.5, 0.1))))    \n  \n# odometry measurements between poses\npush!(resultIds, \n  addFactor(client, context, [\"x1\",\"x2\"], \n    NVA.Pose2Pose2(\n      FullNormal(\n       [1.0, 0.0, pi/2], \n       diagm([0.1, 0.1, 0.01].^2)))))\n\npush!(resultIds, \n  addFactor(client, context, [\"x2\",\"x3\"], \n    NVA.Pose2Pose2(\n      FullNormal(\n       [1.0, 0.0, pi/2], \n       diagm([0.1, 0.1, 0.01].^2)))))\n\npush!(resultIds, \n  addFactor(client, context, [\"x3\",\"x4\"], \n    NVA.Pose2Pose2(\n      FullNormal(\n        [1.0, 0.0, pi/2], \n        diagm([0.1, 0.1, 0.01].^2)))))\n\n# let's wait to make sure all the new additions are ready\nwaitForCompletion(client, resultIds; expectedStatuses=[\"Complete\"])","category":"page"},{"location":"buildgraph/#One-Loop-Closure-Example","page":"Build a Graph","title":"One Loop-Closure Example","text":"","category":"section"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"The robot continued its square trajectory to end off where it started.  To illustrate a loop closure, we add another bearing range sighting to from pose x4 to landmark l1, solve the graph and plot the new results: ","category":"page"},{"location":"buildgraph/","page":"Build a Graph","title":"Build a Graph","text":"resultIds = Task[]\n# add a loop closure landmark observation\npush!(\n  resultIds,\n  addFactor(\n    client, context, \n    [\"x4\",\"l1\"], \n    NVA.Pose2Point2BearingRange(\n      Normal(0, 0.03), \n      Normal(0.5, 0.1))\n  )\n);\n\n# let's wait to make sure all the new additions are ready\nwaitForCompletion(client, resultIds; expectedStatuses=[\"Complete\"])","category":"page"},{"location":"solvers/#Graph-Solvers","page":"Graph Solvers","title":"Graph Solvers","text":"","category":"section"},{"location":"solvers/#Supported-Solvers","page":"Graph Solvers","title":"Supported Solvers","text":"","category":"section"},{"location":"solvers/","page":"Graph Solvers","title":"Graph Solvers","text":"NavAbility provides both parametric and nonparametric (i.e. non-Gaussian / multi-modal) factor graph solving solutions.  Please reach out via email <info@navability.io> or Slack (Image: ) if you would like to learn more about these features.","category":"page"},{"location":"solvers/#Supported-Probabily-Models","page":"Graph Solvers","title":"Supported Probabily Models","text":"","category":"section"},{"location":"solvers/#Gaussian-Case","page":"Graph Solvers","title":"Gaussian Case","text":"","category":"section"},{"location":"solvers/","page":"Graph Solvers","title":"Graph Solvers","text":"Parametric solving supports measurement models using the probability beliefs:","category":"page"},{"location":"solvers/","page":"Graph Solvers","title":"Graph Solvers","text":"Normal\nMvNormal","category":"page"},{"location":"solvers/","page":"Graph Solvers","title":"Graph Solvers","text":"And also currently in beta:","category":"page"},{"location":"solvers/","page":"Graph Solvers","title":"Graph Solvers","text":"Max-Mixture of Normal or MvNormal","category":"page"},{"location":"solvers/#Non-Gaussian-Case","page":"Graph Solvers","title":"Non-Gaussian Case","text":"","category":"section"},{"location":"solvers/","page":"Graph Solvers","title":"Graph Solvers","text":"Non parametric solving can support a much wider range of measurement probability models.  Currently the SDK supports","category":"page"},{"location":"solvers/","page":"Graph Solvers","title":"Graph Solvers","text":"Mixture\nUniform\nRayleigh\nas well as multihypothesis features per factor – i.e. Categorical.","category":"page"},{"location":"solvers/","page":"Graph Solvers","title":"Graph Solvers","text":"Many more probability types are natively supported by the solver and yet directly exposed through the SDK, including","category":"page"},{"location":"solvers/","page":"Graph Solvers","title":"Graph Solvers","text":"Manifold Kernel Densities,\nHeatmaps or Intensity maps,\nLevelsets,\nMost common parametric probability models.","category":"page"},{"location":"solvers/","page":"Graph Solvers","title":"Graph Solvers","text":"Reach out to NavAbility if you seek earlier SDK support for these or other more advanced probability features.","category":"page"},{"location":"start/#getting_started","page":"Getting Started","title":"Getting Started","text":"","category":"section"},{"location":"start/","page":"Getting Started","title":"Getting Started","text":"NavAbility fundamentally organizes mapping, localization, and perception data (a.k.a. navigation data) by means of a visual graphical model known as factor graphs.  See the related documentation on Graph Concepts for more information about what factor graphs.","category":"page"},{"location":"start/#Free-[guest@navability.io]-access","page":"Getting Started","title":"Free [guest@navability.io] access","text":"","category":"section"},{"location":"start/","page":"Getting Started","title":"Getting Started","text":"A free tier access to NavAbility servers is provided through the user guest@navability.io.  To learn more about using the guest user, consider trying the NavAbilty Tutorials.","category":"page"},{"location":"start/#auth_token","page":"Getting Started","title":"Privacy and Auth Token","text":"","category":"section"},{"location":"start/","page":"Getting Started","title":"Getting Started","text":"A user specific authentication token is needed whether you are just accessing an existing graph, modifying, adding data, or building a whole new graph directly through the SDK.  At present, the only way to obtain a temporary authentication token is through the NavAbility App on the \"Connect\" page (or from the App, use the burger menu top left to access the Connect page).  A user login to NavAbility is needed before an auth token can be provided.  Auth tokens last for 24 hours, and should be kept private to each session or usage.  Do not store or share the token with others.  See below for getting a login if you do not already have one.","category":"page"},{"location":"start/#NavAbility-App-Login","page":"Getting Started","title":"NavAbility App Login","text":"","category":"section"},{"location":"start/","page":"Getting Started","title":"Getting Started","text":"You can login via the NavAbility App by clicking on the account menu top right.  please do reach out if you have any questions via Slack (Image: ), emailing us at <info@navability.io>, or filing specific issues against the SDK.","category":"page"},{"location":"start/","page":"Getting Started","title":"Getting Started","text":"<a href=\"https://app.navability.io/get-started/introduction/\">\n<p align=\"center\">\n<img src=\"https://user-images.githubusercontent.com/6412556/218193635-2325bbd1-f82c-4391-8959-8f54b2acdc0a.png\" width=\"240\" border=\"0\" />\n</p>\n</a>","category":"page"},{"location":"start/#Installing","page":"Getting Started","title":"Installing","text":"","category":"section"},{"location":"start/","page":"Getting Started","title":"Getting Started","text":"The NavAbilitySDK can be installed as a usual Julia package:","category":"page"},{"location":"start/","page":"Getting Started","title":"Getting Started","text":"import Pkg; Pkg.add(\"NavAbilitySDK\")","category":"page"},{"location":"start/#Loading-NavAbilitySDK","page":"Getting Started","title":"Loading NavAbilitySDK","text":"","category":"section"},{"location":"start/","page":"Getting Started","title":"Getting Started","text":"Loading the SDK module:","category":"page"},{"location":"start/","page":"Getting Started","title":"Getting Started","text":"using NavAbilitySDK","category":"page"},{"location":"start/","page":"Getting Started","title":"Getting Started","text":"Alternatively, you can also avoid populating the namespace via import:","category":"page"},{"location":"start/","page":"Getting Started","title":"Getting Started","text":"import NavAbilitySDK as NvaSDK","category":"page"},{"location":"start/","page":"Getting Started","title":"Getting Started","text":"note: Note\nThe NavAbility and Caesar.jl design promote distributed factor graph workflows for both edge and cloud usage.  The NavAbilitySDK is part of a larger architecture where both client and server side computations are used.  The rest of this page illustrates usage against the server side data and computations.  Reach out to NavAbility via Slack (Image: ) or <info@navability.io> for more help.","category":"page"},{"location":"#NavAbilitySDK","page":"Home","title":"NavAbilitySDK","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Welcome to the NavAbilitySDK documentation.  Various NavAbilitySDKs exist for different programming languages.  This particular documentation set is for the Julia language package, however, there is strong consistency between the SDKs for various languages.  All the SDKs make standard, authenticated requests to the NavAbility servers, thereby enforcing consistency of operations.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Convenient links to other language NavAbilitySDKs:","category":"page"},{"location":"","page":"Home","title":"Home","text":"NavAbilitySDK.py\nNavAbilitySDK.js","category":"page"},{"location":"","page":"Home","title":"Home","text":"Next, see the Getting Started page.","category":"page"},{"location":"summary/","page":"Index","title":"Index","text":"CurrentModule = NavAbilitySDK","category":"page"},{"location":"summary/#SDK-function-Index","page":"Index","title":"SDK function Index","text":"","category":"section"},{"location":"summary/","page":"Index","title":"Index","text":"Documentation for NavAbilitySDK.","category":"page"},{"location":"summary/","page":"Index","title":"Index","text":"","category":"page"},{"location":"summary/","page":"Index","title":"Index","text":"<!– @autodocs Modules = [NavAbilitySDK] –>","category":"page"}]
}
